import {useState} from 'react'

function Resume(){
    const [show,setShow] = useState(false);
    return(
        <>
            <button onClick={setShow(!show)}>Show Resume</button>
            { show &&
                <embed src="https://docs.google.com/document/d/e/2PACX-1vRg5UjMTO6gyonmQlKNs0YQLQ2cK0ppblRA40cU2RuBobw9ng0jmp-6BtG3U7Dpu9o1Yi9hZ3vRpidf/pub?embedded=true" width={'100%'}></embed>
                }
        </>
        
    );
};

export default Resume;
